"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Valley Fever (coccidioidomycosis) (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H190754809\">",
"      <span class=\"h1\">",
"       What is Valley Fever?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Valley Fever is an infection that can cause cough, fever, tiredness, and other symptoms. The infection is caused by a fungus that lives in soil and can travel in dust specks that you can breathe in. Most people who get Valley Fever get better without treatment. In fact, many people never even realize they have this infection.",
"     </p>",
"     <p>",
"      The fungus that causes Valley Fever is found in:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Southern Arizona",
"       </li>",
"       <li>",
"        Southern and central valleys of California",
"       </li>",
"       <li>",
"        Southwestern New Mexico",
"       </li>",
"       <li>",
"        West Texas",
"       </li>",
"       <li>",
"        Parts of Mexico and Central and South America",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people who visit or live in areas where the Valley Fever fungus is found never get infected. Those who do get infected can usually fight off the infection on their own. But some people can get very sick from the infection. This includes people with HIV, people with certain types of cancer, and people who take medicines that suppress the body&rsquo;s infection-fighting system (called the &ldquo;immune system&rdquo;).",
"     </p>",
"     <p>",
"      Valley Fever is also called &ldquo;coccidioidomycosis.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H190754824\">",
"      <span class=\"h1\">",
"       What are the symptoms of Valley Fever?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Chest pain when taking a deep breath",
"       </li>",
"       <li>",
"        Being tired",
"       </li>",
"       <li>",
"        Aching joints",
"       </li>",
"       <li>",
"        Rash",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The symptoms can be mild and can last for week or months.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H190754839\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have symptoms of Valley Fever and you live in or visited an area where Valley Fever occurs, see a doctor or nurse. He or she will do an exam, learn about your symptoms, and ask where you live and where you have visited.",
"     </p>",
"     <p>",
"      If the doctor or nurse suspects you have Valley Fever, he or she might do tests to look for signs of the fungus that causes Valley Fever. These can include blood tests and tests on a sample of mucus that you cough up.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H190754854\">",
"      <span class=\"h1\">",
"       How is Valley Fever treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Valley Fever does not always need to be treated. If you are fairly healthy, your doctor or nurse might want to wait and see if you can fight off the infection on your own. He or she will want to see you every 2 to 4 weeks to make sure you are getting better.",
"     </p>",
"     <p>",
"      There are medicines called &ldquo;anti-fungals&rdquo; that kill the fungus that causes valley fever. But these medicines can cause serious side effects and people must take them for months or even years, so doctors try to use them only in people who cannot fight off the infection on their own. People who might need anti-fungals include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        People with HIV (or AIDS)",
"       </li>",
"       <li>",
"        People who have had an organ transplant",
"       </li>",
"       <li>",
"        People who have cancers of the blood",
"       </li>",
"       <li>",
"        People who take medicines called &ldquo;steroids&rdquo; or other medicines that partly &ldquo;turn off&rdquo; the immune system",
"       </li>",
"       <li>",
"        Pregnant women",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H190754869\">",
"      <span class=\"h1\">",
"       Can Valley Fever be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you live in an area where Valley Fever occurs, you can reduce your chances of getting infected by staying inside during dust storms and avoiding activities that could expose you to dust or desert soil.",
"     </p>",
"    </div>",
