"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?13/24/13698?source=see_link\">",
"      Patient information: Hirsutism (excess hair growth in women) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?19/40/20099?source=see_link\">",
"      Patient information: Acne (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?1/29/1491?source=see_link\">",
"      Patient information: Bone density testing (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?24/49/25366?source=see_link\">",
"      Patient information: Osteoporosis prevention and treatment (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?9/22/9572?source=see_link\">",
