"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?19/41/20116?source=see_link\">",
"      Patient information: Depression in adults (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?2/16/2306?source=see_link\">",
"      Patient information: Insomnia (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?12/44/12998?source=see_link\">",
"      Patient information: Deep vein thrombosis (DVT) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?2/29/2517?source=see_link\">",
"      Patient information: Pulmonary embolism (Beyond the Basics)",
"     </a>",
"     <br/>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H27\">",
"     <span class=\"h2\">",
"      Professional level information",
"     </span>",
"     &nbsp;&mdash;&nbsp;Professional level articles are designed to keep doctors and other health professionals up-to-date on the latest medical findings. These articles are thorough, long, and complex, and they contain multiple references to the research on which they are based. Professional level articles are best for people who are comfortable with a lot of medical terminology and who want to read the same materials their doctors are reading.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/55/26489?source=see_link\">",
"      Causes and pathophysiology of Cushing's syndrome",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?21/48/22282?source=see_link\">",
"      Epidemiology and clinical manifestations of Cushing's syndrome",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?0/45/730?source=see_link\">",
"      Cushing's syndrome due to ACTH-independent macronodular adrenal hyperplasia",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?4/39/4725?source=see_link\">",
