"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?0/63/1016?source=see_link\">",
"      Overview of the treatment of Cushing's syndrome",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?17/26/17834?source=see_link\">",
