var title_f13_19_13625="Adult TB case 1 PA view";
var content_f13_19_13625=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F74846%7EID%2F70220%7EID%2F54807%7EID%2F56912&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F74846%7EID%2F70220%7EID%2F54807%7EID%2F56912&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Classic adult type TB PA",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chest radiograph, PA view, of an 18 year-old high school student exposed 4 years earlier to an infectious pulmonary tuberculosis patient. She was noncompliant with isoniazid prophylaxis. She now presents with cough for one month, fever and night sweats. PA radiograph shows right upper lobe apical and posterior segment infiltrate with cavitation. This radiograph is \"classic\" for adult-type, reactivation tuberculosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of John Bernardo, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Classic adult TB lateral view",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 497px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    18 year-old high school student, chest radiograph, lateral view.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of John Bernardo, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 486px\">",
"   <div class=\"ttl\">",
"    Classic adult TB PA view case 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 416px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 40 year-old automobile mechanic from the Dominican Republic, in the US 8 years, presented to the urgent care clinic with 4 months of productive cough, fevers, progressive hoarseness, and a 40 pound weight loss. A chest radiograph (PA view) demonstrates diffuse parenchymal disease with multiple cavities and bulla formation on the left. Sputum smear was positive for AFB.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of John Bernardo, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Classic adult TB case 2 lateral",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 395px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 40 year old automobile mechanic with pulmonary tuberculosis, chest radiograph lateral view.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of John Bernardo, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
