var title_f13_19_13628="Antimicrobial prophylaxis for head and neck surgery";
var content_f13_19_13628=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F87201&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F87201&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antimicrobial prophylaxis for head and neck surgery",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Nature of operation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Common pathogens",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended antimicrobials",
"       </td>",
"       <td class=\"subtitle1\">",
"        Usual adult dose*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Incisions through oral or pharyngeal mucosa",
"       </td>",
"       <td rowspan=\"4\">",
"        Anaerobes, enteric gram-negative bacilli, S. aureus",
"       </td>",
"       <td>",
"        Clindamycin",
"       </td>",
"       <td>",
"        600 to 900 mg IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"        cefazolin",
"       </td>",
"       <td>",
"        <sup>",
"         <p>",
"          &lt;80 kg: 1 g IV",
"         </p>",
"         &ge;80 kg: 2 g IV",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        plus metronidazole",
"       </td>",
"       <td>",
"        500&nbsp;mg IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"        ampicillin-sulbactam",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        3 g IV",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Parenteral prophylactic antimicrobials can be given as a single IV dose begun within 60 minutes before the procedure. For prolonged procedures (&gt;3 hours) or those with major blood loss, or in patients with extensive burns, additional intraoperative doses should be given at intervals one to two times the half-life of the drug (ampicillin-sulbactam&nbsp;every 2 hours, cefazolin every 4 hours, cefuroxime every 4 hours, cefoxitin every 2 hours, clindamycin every 6 hours, vancomycin every 12 hours) for the duration of the procedure in patients with normal renal function. If vancomycin or a fluoroquinolone is used, the infusion should be started within 60 to 120 minutes before the initial incision to have adequate tissue levels at the time of incision and to minimize the possibility of an infusion reaction close to the time of induction of anesthesia.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Due to increasing resistance of E. coli to fluoroquinolones and ampicillin-sulbactam, local sensitivity profiles should be reviewed prior to use.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with special permission from: Treatment Guidelines from The Medical Letter, October 2012; Vol. 10 (122):73.",
"     <a href=\"file://www.medicalletter.org\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      www.medicalletter.org",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
